import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import { ExamEngine } from './components/ExamEngine';

// Import shared types
import type { User, Question, ExamResult, TopicScore } from '../../shared/types';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Databricks Practice Exam</h1>
          <p>Certified Data Engineer Associate Preparation</p>
        </header>

        <main>
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/exam" element={<ExamPage />} />
            <Route path="/results" element={<ResultsPage />} />
            <Route path="/study" element={<StudyPage />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

// Placeholder components
const HomePage: React.FC = () => (
  <div>
    <h2>Welcome to Databricks Practice Exam</h2>
    <p>Prepare for your Databricks Certified Data Engineer Associate certification</p>
  </div>
);

const ExamPage: React.FC = () => {
  const handleExamComplete = (result: ExamResult) => {
    console.log('Exam completed:', result);
    // Here you could navigate to results page or show results
  };

  return (
    <div>
      <ExamEngine 
        userId="demo-user-123" 
        examType="practice"
        onExamComplete={handleExamComplete}
      />
    </div>
  );
};

const ResultsPage: React.FC = () => (
  <div>
    <h2>Exam Results</h2>
    <p>Results and analytics will be displayed here</p>
  </div>
);

const StudyPage: React.FC = () => (
  <div>
    <h2>Study Mode</h2>
    <p>Question bank and study materials will be available here</p>
  </div>
);

export default App;
